import React from "react";
import "../styles/Experience.css";

const experiences = [
  {
    year: "2025",
    title: "Frontend Intern – Bano Qabil Incubation",
    description:
      "Worked on real-world web applications using React, Next.js, and Tailwind. Gained hands-on experience in building production-ready components.",
  },
  {
    year: "2024",
    title: "Freelance Projects",
    description:
      "Built websites for local clients using modern tools. Learned how to manage full projects independently from design to deployment.",
  },
  {
    year: "2023",
    title: "Started Learning Web Development",
    description:
      "Began my journey with HTML, CSS, and JavaScript. Created my first mini-projects and discovered my love for frontend development.",
  },
];

function Experience() {
  return (
    <section className="experience-section">
      <h2 className="section-heading">Experience Timeline</h2>
      <div className="timeline">
        {experiences.map((exp, index) => (
          <div key={index} className="timeline-item">
            <div className="timeline-dot" />
            <div className="timeline-content">
              <h3>{exp.year}</h3>
              <h4>{exp.title}</h4>
              <p>{exp.description}</p>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
}

export default Experience;
